import React from 'react';
import { Typography, Box } from '@mui/material';

const ShippingDate = ({ date }) => {
  return (
    <Box>
      <Typography variant="body1" style={{ visibility: date ? 'visible' : 'hidden' }}>
        {date || 'Дата отправки'}
      </Typography>
    </Box>
  );
};

export default ShippingDate;
